script: |
  super -f text -I q13792.spq | sort > q13792.out

inputs:
  - name: q13792.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT ( - col2 ) NOT BETWEEN ( col2 + col0 * - col0 ) AND + col0 * 91;
  - name: tab0

outputs:
  - name: q13792.out
    data: |
      15	81	47
      87	21	10
      97	1	99
